import React from 'react';
import Card from './card/Card'
import "./App.css";
import Title from './Title'


const App = () =>{
return(
    <div className="main-layout">
    <Title title="checkout page"/>
    
    <div className="price-details">
    <Title title="Price details" style={{marginLeft:"10%"}}/>
    <div className="items">
    <p>Price 2 items </p>
    <p>Deliver charges </p>
    <p>Amount Payable </p>
    </div>
 

    </div>
     <Card/>
     
    
     </div>
       
    
)

}
export default App;
